import React, { Component } from "react";

class Login extends Component {
  render() {
    return (
      <React.Fragment>
        <div>
          <form>
            <input
              type="text"
              id="login"
              class="fadeIn second"
              name="login"
              placeholder="login"
            ></input>
            <input
              type="text"
              id="password"
              class="fadeIn third"
              name="login"
              placeholder="password"
            ></input>
            <button className="btn-secondary btn-md">Login</button>
          </form>
        </div>
      </React.Fragment>
    );
  }
}

export default Login;
